import React from "react";
import "./App.css";
import Calculator from "./components/Calculator/Calculator";
import CalculationList from "./components/calculationList/calculationList";
import { Header } from "./components/header/header";

function App() {
  return (
    <div className="App">
      <Header />
      <Calculator />
      <CalculationList />
    </div>
  );
}

export default App;
